import React from 'react'
import './portfolio.css'

const PPayouts = () => {
    return(
        <div className='PPayouts'>
            <div className="p-payouts-div">'
                <button className="p-payouts-btn">Collect Win Payouts</button>
            </div>
        </div>
    )
}

export default PPayouts
